import React from "react";

function Home( {userInfo} ) {
  const email = userInfo.email;
  const uid = userInfo.uid;

  return (

    <div className="Wrapper">
      <h1>Home</h1>
      <p>Welcome, {email}</p>
      <p>{uid}</p>
    </div>
  )
};

export default Home;
